import React from 'react'

const Main = props => {
    console.log(props)
    if (this) console.log(this.props.location.state)
    return (
        <div>
            <h1>Main</h1>
            <p>{props.accessToken}</p>
            <p>{props.refreshToken}</p>
        </div>
    )
}

export default Main
